data: {"type":"data-tool-result","id":"call_598ceec2162a4cd18874457a","data":{"toolCallId":"call_598ceec2162a4cd18874457a","result":{"content":"     1→# Domestik Vendor Registration → Verification Conversion Plan\n     2→\n     3→## 📋 Executive Summary\n     4→\n     5→This document outlines the comprehensive transformation of the **Domestik Vendor Registration** system from a **create/edit workflow** to a **verification/approval workflow**, matching the simplicity and capability of the **International Vendor Verification** system while preserving the complex field requirements unique to domestic vendors.\n     6→\n     7→### 🎯 Conversion Goals\n     8→\n     9→- **Maintain Field Complexity**: Keep all domestik-specific fields and requirements\n    10→- **Simplify User Interaction**: Convert from editable forms to read-only display\n    11→- **Add Approval Capability**: Implement approve/reject functionality like international version\n    12→- **Preserve Vendor Types**: Maintain 4 vendor types (ATPM, Manufaktur, Distributor, Importir)\n    13→- **Follow International Pattern**: Use same URL routing, breadcrumb navigation, and permission system\n    14→\n    15→---\n    16→\n    17→## 🏗️ Current vs Target Architecture\n    18→\n    19→### Current State (Registration)\n    20→\n    21→```mermaid\n    22→graph TD\n    23→    A[User Input] --> B[Form Validation]\n    24→    B --> C[API Create Call]\n    25→    C --> D[Success/Error Response]\n    26→    D --> E[Redirect to Vendor List]\n    27→\n    28→    style A fill:#ffeb3b\n    29→    style B fill:#ffeb3b\n    30→    style C fill:#ffeb3b\n    31→```\n    32→\n    33→### Target State (Verification)\n    34→\n    35→```mermaid\n    36→graph TD\n    37→    A[Vendor ID from URL] --> B[Fetch Vendor Data]\n    38→    B --> C[Transform API → Display]\n    39→    C --> D[Read-Only Form Display]\n    40→    D --> E[User Approval/Rejection]\n    41→    E --> F[Transform Form → API Update]\n    42→    F --> G[Update Vendor Status]\n    43→    G --> H[Redirect to Vendor List]\n    44→\n    45→    style A fill:#4caf50\n    46→    style D fill:#4caf50\n    47→    style E fill:#4caf50\n    48→    style F fill:#4caf50\n    49→```\n    50→\n    51→---\n    52→\n    53→## 🔧 Detailed Implementation Plan\n    54→\n    55→### Phase 1: API Services & Data Layer\n    56→\n    57→#### 1.1 Create Domestic Vendor Detail Service\n    58→\n    59→**File**: `src/services/vendor-domestik/getSellerDetailDomestic.ts`\n    60→\n    61→```typescript\n    62→export interface SellerDetailDomesticResponse {\n    63→  id: string;\n    64→  // Account Information\n    65→  accountInformation: {\n    66→    email: string;\n    67→    phoneNumber: string;\n    68→    picName: string;\n    69→    emailPic: string;\n    70→    picPhoneNumber: string;\n    71→    position: string;\n    72→    companyDetail: {\n    73→      name: string;\n    74→      businessType: { id: string; name: string };\n    75→      productType: { id: string; name: string };\n    76→      addressDetail: string;\n    77→      location: string;\n    78→      city: string;\n    79→      cityId: number;\n    80→      province: string;\n    81→      provinceId: number;\n    82→      postalCode: string;\n    83→      latitude: number;\n    84→      longitude: number;\n    85→      logoPath: string;\n    86→      companyPhones: Array<{ phoneNumber: string; isPrimary: boolean }>;\n    87→    };\n    88→    // Domestik specific\n    89→    npwp: string;\n    90→    sppkpFile: string;\n    91→  };\n    92→\n    93→  // Legal Information\n    94→  legalitas: {\n    95→    documents: Array<{\n    96→      documentType:\n    97→        | \"nib\"\n    98→        | \"deed_of_establishment\"\n    99→        | \"kemenkumham_decree\"\n   100→        | \"latest_amendment_deed\";","metadata":{"truncated":false,"lineCount":1893,"filePath":"conversion-plan.md","preview":false}}}}

