data: {"type":"data-tool-result","id":"call_25300aeb2fd2449b9e1bbbe2","data":{"toolCallId":"call_25300aeb2fd2449b9e1bbbe2","result":{"content":"     1→# Location Management Refactoring Plan - React Hook Form Integration\n     2→\n     3→## Executive Summary\n     4→\n     5→This document outlines a comprehensive refactoring plan to integrate the existing location management system with React Hook Form (RHF). The goal is to replace the current `onLocationChange` callback system with direct RHF control integration, using hidden inputs to manage the complex location data structure.\n     6→\n     7→## Current State Analysis\n     8→\n     9→### Existing Architecture\n    10→\n    11→- **Provider**: `LocationFieldProvider` uses XState machine for state management\n    12→- **Data Flow**: Location changes trigger `onLocationChange` callback\n    13→- **Data Structure**: Complex nested object with multiple location properties\n    14→- **Form Integration**: Manual callback system requiring parent components to handle location data\n    15→\n    16→### Current Data Structure\n    17→\n    18→```typescript\n    19→{\n    20→  address: string,        // User manual fill\n    21→  city: string,\n    22→  cityId?: number,\n    23→  district: string,\n    24→  districtId?: number,\n    25→  province: string,\n    26→  provinceId?: number,\n    27→  country: string,\n    28→  postalCode: string,\n    29→  coordinates: {\n    30→    latitude: number,\n    31→    longitude: number,\n    32→  },\n    33→  formattedAddress?: string,\n    34→  // Additional metadata...\n    35→}\n    36→```\n    37→\n    38→## Target Architecture\n    39→\n    40→### Design Principles\n    41→\n    42→1. **Direct RHF Integration**: Use RHF's `control` and `setValue` for direct form manipulation\n    43→2. **Hidden Inputs**: Create hidden inputs for each location property\n    44→3. **Maintain API Compatibility**: Keep existing location functionality intact\n    45→4. **Type Safety**: Leverage TypeScript for robust type checking\n    46→5. **Performance**: Minimize re-renders and unnecessary updates\n    47→\n    48→### New Data Structure\n    49→\n    50→```typescript\n    51→{\n    52→  addressDetail: string,        // User manual fill\n    53→  addressFormatted: string,     // Formatted address from search/API\n    54→\n    55→  coordinates: {\n    56→    latitude: number,\n    57→    longitude: number,\n    58→  },\n    59→\n    60→  city: {\n    61→    cityId: number,\n    62→    cityName: string,\n    63→  },\n    64→\n    65→  province: {\n    66→    provinceId: number,\n    67→    provinceName: string,\n    68→  },\n    69→\n    70→  district: {\n    71→    districtId: number,\n    72→    districtName: string,\n    73→  },\n    74→\n    75→  postalCode: string,\n    76→}\n    77→```\n    78→\n    79→## Implementation Plan\n    80→\n    81→### Phase 1: Type Definitions and Interface Updates\n    82→\n    83→#### 1.1 Update Location Types\n    84→\n    85→```typescript\n    86→// New RHF-integrated location types\n    87→export interface RHFLocationData {\n    88→  addressDetail: string;\n    89→  addressFormatted: string;\n    90→  coordinates: {\n    91→    latitude: number;\n    92→    longitude: number;\n    93→  };\n    94→  city: {\n    95→    cityId: number;\n    96→    cityName: string;\n    97→  };\n    98→  province: {\n    99→    provinceId: number;\n   100→    provinceName: string;","metadata":{"truncated":false,"lineCount":564,"filePath":"refactor-location.md","preview":false}}}}

